import React, { Component } from 'react';
import {Breadcrumb, CardHeader} from 'reactstrap';
import Breadcrumbs from './Breadcrumbs';
import Header from './Header';
import Content from './Content';
import Footer from './Footer'

class Canvan extends Component{
	constructor(props) {
		super(props);
		this.state = {}
    }

    componentDidMount(){
        console.log("hola mundo");
    }

	render(){
        const pos = {barr:{size: 10, offset: 1}, logo:"1", barSerch:"11"}
		return(
            <Row>
                <Col xs={pos.barr} sm={pos.barr} md={pos.barr}>
                    <CardHeader>
                        <Header/>
                    </CardHeader>
                    <Breadcrumb>
                        <Breadcrumbs/>
                    </Breadcrumb>
                    <Content/>
                    <Footer/>
                </Col>
            </Row>
		)	
	}
}

export default Canvan;
